import React, {useState} from 'react';
import './table.css';

export default class Backend extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            error: null,
            isLoaded: false,
            subscribers: []
        };
    }

    componentDidMount() {
        fetch("https://api.sheety.co/a4c738ad49ee1d97b368830238289575/subscribers/subscribers")
            .then(res => res.json())
            .then(
                (result) => {
                    this.setState({
                        isLoaded: true,
                        items: result.subscribers,
                    });
                },
                // Note: it's important to handle errors here
                // instead of a catch() block so that we don't swallow
                // exceptions from actual bugs in components.
                (error) => {
                    this.setState({
                        isLoaded: true,
                        error
                    });

                }
            )
    }

    render() {
        const { error, isLoaded, subscribers } = this.state;
        if (error) {
            return <div>Error: {error.message}</div>;
        } else if (!isLoaded) {
            return <div>Loading...</div>;
        } else {
            return (
                <ul>
                    {subscribers.map(subscriber => (
                        <li key={subscriber.id}>
                            {subscriber.name} {subscriber.emailAddress}
                        </li>
                    ))}
                </ul>
            );
        }
    }
}
